import * as types from "../constants/ActionTypes";

const initialState = {
    // loginStatus:false,
}

function setSignup(state, payload) {
    return payload
}

const Cart = (state = initialState, action) => {
    switch (action.type) {
        case types.SIGNUP :
            return setSignup(state,action.payload);
        default:
            return state;
    }
}
export default Cart;
